import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useState, useEffect } from 'react';
import CoverSlide from './slides/CoverSlide';
import BigIdeaSlide from './slides/BigIdeaSlide';
import MarketStrategiesSlide from './slides/MarketStrategiesSlide';
import RevenuePotentialSlide from './slides/RevenuePotentialSlide';
import PartnershipsSlide from './slides/PartnershipsSlide';
import DeliverableSlide from './slides/DeliverableSlide';
import ViralStrategySlide from './slides/ViralStrategySlide';

const PitchDeck = () => {
  useEffect(() => {
    const canvas = document.createElement('canvas');
    const ctx = canvas.getContext('2d');
    canvas.style.position = 'fixed';
    canvas.style.top = '0';
    canvas.style.left = '0';
    canvas.style.width = '100%';
    canvas.style.height = '100%';
    canvas.style.pointerEvents = 'none';
    canvas.style.zIndex = '1';
    canvas.style.opacity = '0.4';
    document.body.appendChild(canvas);

    const resizeCanvas = () => {
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
    };
    
    window.addEventListener('resize', resizeCanvas);
    resizeCanvas();

    const afrobeatsColors = [
      'rgba(255, 128, 0, 0.3)',  // Orange
      'rgba(255, 215, 0, 0.3)',  // Gold
      'rgba(0, 255, 127, 0.3)',  // Spring Green
      'rgba(255, 0, 127, 0.3)',  // Pink
      'rgba(148, 0, 211, 0.3)'   // Purple
    ];

    const symbols = ['â™ª', 'â™«', 'â™¬', 'ðŸŽµ', 'ðŸŽ¶'];
    const symbolsArray = [];

    for (let i = 0; i < 40; i++) {
      symbolsArray.push({
        x: Math.random() * canvas.width,
        y: Math.random() * canvas.height,
        symbol: symbols[Math.floor(Math.random() * symbols.length)],
        color: afrobeatsColors[Math.floor(Math.random() * afrobeatsColors.length)],
        size: 15 + Math.random() * 25,
        rotation: Math.random() * Math.PI * 2,
        speed: 0.2 + Math.random() * 0.3,
        pulse: Math.random() * Math.PI * 2
      });
    }

    const animate = () => {
      ctx.clearRect(0, 0, canvas.width, canvas.height);

      symbolsArray.forEach(symbol => {
        ctx.save();
        ctx.translate(symbol.x, symbol.y);
        ctx.rotate(symbol.rotation);
        
        // Add pulsing effect
        symbol.pulse += 0.02;
        const scale = 1 + Math.sin(symbol.pulse) * 0.2;
        ctx.scale(scale, scale);
        
        ctx.font = `${symbol.size}px Arial`;
        ctx.fillStyle = symbol.color;
        ctx.fillText(symbol.symbol, 0, 0);
        ctx.restore();

        symbol.y -= symbol.speed;
        symbol.rotation += 0.01;

        if (symbol.y < -50) {
          symbol.y = canvas.height + 50;
          symbol.x = Math.random() * canvas.width;
        }
      });

      requestAnimationFrame(animate);
    };

    animate();

    return () => {
      window.removeEventListener('resize', resizeCanvas);
      document.body.removeChild(canvas);
    };
  }, []);

  return (
    <PageContainer>
      <GradientOverlay />
      <ContentWrapper>
        <Section>
          <CoverSlide />
        </Section>
        
        <Divider />
        
        <Section>
          <BigIdeaSlide />
        </Section>
        
        <Divider />
        
        <Section>
          <MarketStrategiesSlide />
        </Section>
        
        <Divider />
        
        <Section>
          <RevenuePotentialSlide />
        </Section>
        
        <Divider />
        
        <Section>
          <PartnershipsSlide />
        </Section>
        
        <Divider />
        
        <Section>
          <DeliverableSlide />
        </Section>
        
        <Divider />
        
        <Section>
          <ViralStrategySlide />
        </Section>
      </ContentWrapper>
    </PageContainer>
  );
};

const PageContainer = styled.div`
  width: 100%;
  min-height: 100vh;
  background: linear-gradient(135deg, #1a0f3c 0%, #2d1b4e 50%, #3d2960 100%);
  color: white;
  overflow-x: hidden;
  position: relative;
`;

const GradientOverlay = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background: 
    radial-gradient(circle at 20% 30%, rgba(255, 128, 0, 0.15) 0%, transparent 40%),
    radial-gradient(circle at 80% 70%, rgba(148, 0, 211, 0.15) 0%, transparent 40%),
    radial-gradient(circle at 50% 50%, rgba(0, 255, 127, 0.1) 0%, transparent 50%);
  pointer-events: none;
  z-index: 1;
`;

const ContentWrapper = styled.div`
  max-width: 1400px;
  margin: 0 auto;
  padding: 2rem;
  position: relative;
  z-index: 2;
  
  @media (max-width: 768px) {
    padding: 1rem;
  }
`;

const Section = styled.section`
  padding: 4rem 0;
  position: relative;
  
  &:first-child {
    min-height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
  }
  
  &:not(:first-child) {
    margin-top: 2rem;
  }

  // Add subtle glow on hover
  &:hover {
    &::after {
      content: '';
      position: absolute;
      top: 0;
      left: -20%;
      width: 140%;
      height: 100%;
      background: radial-gradient(
        circle at center,
        rgba(255, 215, 0, 0.1) 0%,
        transparent 70%
      );
      pointer-events: none;
      z-index: -1;
    }
  }
`;

const Divider = styled.div`
  width: 100%;
  height: 2px;
  background: linear-gradient(
    90deg,
    transparent,
    rgba(255, 128, 0, 0.3),
    rgba(148, 0, 211, 0.3),
    rgba(255, 128, 0, 0.3),
    transparent
  );
  margin: 2rem 0;
  position: relative;
  
  &::after {
    content: '';
    position: absolute;
    top: -1px;
    left: 0;
    right: 0;
    height: 4px;
    background: inherit;
    filter: blur(2px);
    opacity: 0.5;
  }
`;

export default PitchDeck;
